import React from 'react';
import './repository.css';
import StackRecetteIcon from '../../images/stackrecette.jpg'


export class StackRecette extends React.Component {

    render() {
        return (
            <React.Fragment>
                <p className="projects-title">StackRecette</p>
                <img src={StackRecetteIcon} alt="app sample" className="sample"/>
                <p className="sr-description">
                The purpose of the app was to give people the fastest and easiest
                way to find a recipe from the user's ingredients. the
                user does require some cooking experience.
                The user will also require an Android phone with Android Ice Cream Sandwich
                (4.0) or greater. And if the user is running an emulator, he/she will need an
                AVD that runs the Google api, including Google play services version
                15 and above.
                </p>
                <a href="https://www.github.com/rudypflores/StackRecette" target="_blank" rel="noopener noreferrer" className="sr-link">
                    Find out more!
                </a>
            </React.Fragment> 
        );
    }
}

